import React from "react";
import TableCell from "@material-ui/core/TableCell";
import TableRow from "@material-ui/core/TableRow";
import {Link} from "react-router-dom";

const Employee = ({id, fullName, bDay, selectEmployee, getEmployeesData, isLoaded}) => {

    let onEmployeeSelected = (id) => {
        selectEmployee(id);
        console.log(birthDate);
    }

    const dateArray = bDay.split("-");
    let birthDate = new Date(dateArray[2], dateArray[1], dateArray[0]);
    birthDate = `${birthDate.getDate()}.${birthDate.getMonth()}.${birthDate.getFullYear()}`
    // const birthDate = `${unformatedDate.getDate()}.${unformatedDate.getMonth()} ${unformatedDate.getFullYear()}`

    return (
        <TableRow>
            <TableCell>{id}</TableCell>
            <TableCell> <Link onClick={() => onEmployeeSelected(id)} to="/worktime">{fullName}</Link> </TableCell>
            <TableCell>{birthDate}</TableCell>
        </TableRow>
    )
};

export default Employee;
